import React from 'react';
import { Link } from 'react-router-dom';
import Keyboard from './Keyboard';

const Home = () => {

  return (
    <div className='container-xxl py-3 display--1'>
      <h1>Hello World</h1>
      <Link to="/home">Home</Link>
      <Keyboard></Keyboard>
    </div>
  );
};

export default Home;
